import React from "react";
const { useState, useEffect } = React;

const Session = () => {
  let [info, setInfo] = useState({
    nombre: "",
    perrosFavoritos: [],
    perros: [],
  });

  const getUser = async () => {
    let responseFromGet = await fetch("http://localhost:3000/usuario", {
      method: "GET",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
        token: window.localStorage.token,
      },
    })
      .then((response) => response.json())
      .then((result) => {
        return result;
      });
    let username = responseFromGet.nombre;
    let favoriteDogs = responseFromGet.perrosFavoritos;
  let vetDogs = responseFromGet.perros;
    let perros = favoriteDogs.map((perro) => {
      let dogObject = {
        id: perro._id,
        nombre: perro.nombre,
        raza: perro.raza,
      };
      return dogObject;
    });
    let perrosVet = vetDogs.map((perro)=>{
        let objetoPerro = {
            id: perro._id,
            nombre: perro.nombre,
            raza: perro.raza
        }
        return objetoPerro
    })
    let userInfo = {
      nombre: username,
      perrosFavoritos: perros,
      perros: perrosVet,
    };
    setInformation(userInfo);
  };

  const setInformation = (information) => {
    setInfo({
      nombre: information.nombre,
      perrosFavoritos: information.perrosFavoritos,
      perros: information.perros,
    });
    let responseForVet = async ()
  };

  useEffect(() => {
    getUser();
  }, []);

  if (info.usuario === "") {
    return <div>Cargando...</div>;
  } else {
    return (
      <div>
        <p>Welcome {info.nombre}</p>
        <h5>Tus perros favoritos son:</h5>
        <table className="table table-striped table-dark">
            <tbody>
        {info.perrosFavoritos.map((perro) => {
          return( <tr key ={`perro-container-${perro.id}`}>
              <td key={`perro-name-${perro.id}`}>{perro.nombre}</td> 
              <td key={`perro-raza-${perro.id}`}>{perro.raza}</td>
          </tr>)

        })}</tbody>
        </table>
        {/* <table>
        {info.perros.map((perro) => {
          return( <tr key ={`perro-container-${perro.id}`}>
              <td key={`perro-name-${perro.id}`}>{perro.nombre}</td> 
              <td key={`perro-raza-${perro.id}`}>{perro.raza}</td>
          </tr>)
          ;
        })}
        </table> */}
      </div>
    );
  }
};

export default Session;
